import React from 'react';
import { IonList, IonItem } from '@ionic/react';
import './InformationPage.css';

const InformationPage: React.FC = () => {
    return ( 
        <IonList> 
            <div className="list">
                <a href="/DogFighting"><IonItem>Dog Fighting</IonItem></a>
            </div>
        </IonList>
    )
}

export default InformationPage;
